INSERT INTO `city` VALUES (1,'上海','上海位于中国东部，地处长江入海口，面向太平洋。它与邻近的浙江省、江苏\n省、安徽省构成长江三角洲，是中国经济发展最活跃、开放程度最高、创新能\n力最强的区域之一。嘉定区位于上海西北部，是建设中的上海国际汽车城所在\n地。东与宝山、普陀两区接壤；西与江苏省昆山市毗连；南襟吴淞江，与闵\n行、长宁、青浦三区相望；北依浏河，与江苏省太仓市为邻。 \n','上海全市面积6,340.50平方公里，建成区面积1,237.85平方公里，占全国总面\n积的0.06%，其中陆地面积6,218.65平方公里，水面面积121.85平方公里。上\n海下辖16个市辖区，即黄浦区、长宁区、静安区、普陀区、虹口区、杨浦区、\n徐汇区、闵行区、宝山区、浦东新区、嘉定区、金山区、松江区、青浦区、奉\n贤区及崇明区。');
/*!40000 ALTER TABLE `city` ENABLE KEYS */;
